import React, { useState, useEffect } from 'react'
import playersService from '../services/playersService';
import PlayerDataService from "../services/playersService";
const TournamentResults = (props) => {
    const initialPlayerState = {
        id: null,
        name: "",
    }

    const [playersList, setPlayersList] = useState([])
    const [player, setPlayer] = useState(initialPlayerState);

    // FIX INDEX LATER
    const getPlayersList = () => {
        const list = []
        for(let i=1; i < props.scorecards.length; i++){
            PlayerDataService.get(props.scorecards[i].playerId)
                .then(response => {
                    console.log("Player: " + response.data)
                    setPlayer(response.data)
                    list.push(player)
                    console.log("List: " + list.length)
                })
        }
        setPlayersList(playersList)
        console.log("Length of Players List: " + playersList.length)
    }

    useEffect(() => {
        getPlayersList()
    })

    return(
        <div>
            <div>
                Yes
            </div>
            <div>
                {player.name}
            </div>
        </div>
    )
}
export default TournamentResults
